import React from "react";

export default function Login() {
    return(
        <div className="login">
            <p className="login__title">Вход</p>
            <div className="login__form">
                <input id="email" type="email" className="login__input login__input_value_email" />
                <span id="email-error" className="login__input-error" />
                <input id="password" type="password" className="login__input login__input_value_password" />
                <span id="password-error" className="login__input-error" />
                <button className="login__button">Войти</button>
            </div>
        </div>
    )
}
